import {AUTH,LOGOUT} from '../actions/actiontype';

const authReducer = (state,action)=>{
    switch(action.type){
        case AUTH:
            console.log(action?.data);

       // case LOGOUT:
         //   return state;
        default:
            break;
    }
}
export default authReducer;
